body:
Added:
- the last selected path saving in Inner File manager (only for a session);
- language switching.

Updated:
- project structure;
- device info parameters in Feedback.

New:
- refactored project structure;
- optimized app entities.

Added new languages:
- Hebrew;
- Italian;
- Polish;
- Spanish;
- Korean;
- Chinese;
- Persian;
- Hungarian;
- Swedish;
- French;
- Greek;
- Dutch.

Added:
- user data export;
- Privacy Policy link.

Added languages:
- Russian;
- German.

Updated:
- SDK version from 28 to 29;
- "Inner file manager" now supported on devices with OS version below Android 10 (Q).

Added:
- export hash value support.

Project changes:
- migrated to AndroidX;
- added tests;
- updated libraries.

Major update with:
- History;
- bug fixes.
